import UserEntry from "./UserEntry";
import UserDetails from "./UserDetail";

const USerContainer = () => {
  return (
    <Grid container>
      <Grid item xs={6}>
        <UserEntry />
      </Grid>
      <Grid item xs={6}>
        <UserDetails />
      </Grid>
    </Grid>
  );
};
